import React from 'react';

function Todo(props) { 
    const {todo, handleCloseClick} = props;
    return(    
        <div className="Todo"> 
            <span> {todo} </span>
            <button 
                className="Close"
                onClick={() => handleCloseClick}
            > 
                x 
            </button>
        </div> 
    )

}

export default Todo;
